import React from "react";
import { Card } from "antd";
const Todo = () => {
  return (
    <Card
      actions={[
        <div key="edit">
          <br />
        </div>,
        <div key="setting">
          <br />
        </div>,
      ]}
    ></Card>
  );
};

export default Todo;
